import React from 'react';
import Header from './Header';

function App() {

  let contador = 0;

  function incrementCounter(contador) {
    contador++;
  }

  return (

    <>

     <h1>contador: {contador}</h1>
     <button onClick={incrementCounter}>Incrementar</button>

    </>

  );
}

export default App;
